    try {
      const movies = await fetch('http://localhost:3001/api/')
    } catch (err) {
      console.error(err)
    }
  }

  return (
    <div className="App">
      <input placeholder='Enter movie name'/>
      <button>Find Tickets</button>
    </div>
  );
}

